import ListComponent from './ListComponent'
function Button() {
    const[name , setName] = useState('');
    const handleClick = ()=>{
        useState(name)
    }
  return (
    <div>
        <button onClick={handleClick}>click</button>
        <ListComponent></ListComponent>
    </div>
  )
}

export default Button;
